import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import './Home.scss';

// Components
import BottomNav from '../../components/common/BottomNav';
import BusinessCard from '../../components/Business/BusinessCard';
import IncomeCounter from '../../components/common/IncomeCounter';
import Button from '../../components/common/Button';

// Mock data
import { Business } from '../../types/business';

const Home: React.FC = () => {
  const navigate = useNavigate();
  const [balance, setBalance] = useState(1000);
  const [totalIncome, setTotalIncome] = useState(50);
  
  // Mock businesses data
  const [businesses, setBusinesses] = useState<Business[]>([
    {
      business_id: '1',
      owner_id: 'user1',
      name: 'Киоск',
      type: 'legal',
      level: 1,
      income_per_hour: 20,
      cost: 500,
      upgrade_cost: 300,
      purchased_at: new Date()
    },
    {
      business_id: '2',
      owner_id: 'user1',
      name: 'Курьерская служба',
      type: 'legal',
      level: 1,
      income_per_hour: 30,
      cost: 1000,
      upgrade_cost: 600,
      purchased_at: new Date()
    }
  ]);

  // Simulate income generation
  useEffect(() => {
    const incomeInterval = setInterval(() => {
      setBalance(prevBalance => {
        const hourIncome = businesses.reduce((sum, business) => sum + business.income_per_hour, 0);
        const incomePerSecond = hourIncome / 3600;
        return parseFloat((prevBalance + incomePerSecond).toFixed(2));
      });
    }, 1000);

    return () => clearInterval(incomeInterval);
  }, [businesses]);

  const handleInviteFriends = () => {
    // Здесь будет логика приглашения друзей
    alert('Функция приглашения друзей будет доступна позже');
  };

  const navigateToBusiness = () => {
    navigate('/business');
  };

  const navigateToDarknet = () => {
    navigate('/darknet');
  };

  const navigateToDrops = () => {
    navigate('/drops');
  };

  return (
    <div className="home-page">
      <div className="home-page__balance">
        <h1>{balance.toFixed(2)}</h1>
        <p>Ваш баланс</p>
      </div>
      
      <IncomeCounter incomePerHour={totalIncome} />
      
      <div className="home-page__actions">
        <Button 
          variant="primary" 
          size="large" 
          fullWidth 
          icon="👥" 
          onClick={handleInviteFriends}
        >
          Пригласить друзей
        </Button>
      </div>
      
      <div className="home-page__section">
        <div className="home-page__section-header">
          <h2>Ваши бизнесы</h2>
          <span className="home-page__section-action" onClick={navigateToBusiness}>
            Все бизнесы
          </span>
        </div>
        <div className="home-page__business-list">
          {businesses.map(business => (
            <BusinessCard 
              key={business.business_id} 
              business={business} 
              onClick={navigateToBusiness}
            />
          ))}
        </div>
      </div>
      
      <div className="home-page__quick-actions">
        <div className="home-page__quick-action" onClick={navigateToBusiness}>
          <div className="home-page__quick-action-icon">💼</div>
          <div className="home-page__quick-action-label">Бизнесы</div>
        </div>
        <div className="home-page__quick-action" onClick={navigateToDrops}>
          <div className="home-page__quick-action-icon">👥</div>
          <div className="home-page__quick-action-label">Дропы</div>
        </div>
        <div className="home-page__quick-action" onClick={navigateToDarknet}>
          <div className="home-page__quick-action-icon">🌑</div>
          <div className="home-page__quick-action-label">Даркнет</div>
        </div>
      </div>
      
      <BottomNav />
    </div>
  );
};

export default Home;
